import Logements from "../logements.json"
import '../Styles/index_Fiche_Logements.css'

function Fiche_Logement() {
    // Utilisez la méthode map pour parcourir les éléments du tableau Logements
    Logements.map((logement,id) => {
        console.log(id); // Affiche chaque logement avec son index dans la console
        return null; // Vous devez retourner quelque chose dans la méthode map, null dans ce cas
    });

    return (
        <div className="space_Logement">
            {/* Ici, vous pouvez afficher les informations des logements */}
        </div>
    );
}

export default Fiche_Logement;
